import React from 'react';
import { ErrorMessage } from 'formik';

function AssetSubForm(props) {
    if(props.asset_type == 'House') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
                <div className="my-2">
                    Address
                </div>
                <div className="my-2">
                    Door No.
                </div>
                <div class="input-group mb-3">
                    <span class="input-group-text" id="door_numbers">No.</span>
                    <input type="number" class="form-control max-wid-5" placeholder="Door Number"  id="door_number"  name="door_number" aria-label="Door Number" aria-describedby="basic-addon1" onChange={props.func.handleChange} onBlur={props.func.handleBlur} value={props.func.values.door_number} />
                </div>
                <div className="mb-3">
                    <label htmlFor="street" className="form-label">Street:</label>
                    <input type="text" className={'form-control' + (props.func.errors.street && props.func.touched.street ? ' is-invalid' : '')} id="street" name="street" placeholder="Enter street" onChange={props.func.handleChange} onBlur={props.func.handleBlur} value={props.func.values.street} />
                    <ErrorMessage name="street" component="span" className="text-danger" />
                </div>
            </div>
        );
    } else if(props.asset_type == 'Appartment') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
                <div>

                </div>
            </div>
        );
    } else if(props.asset_type == 'Store') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
            </div>
        );
    } else if(props.asset_type == 'Koddon') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
            </div>
        );
    } else if(props.asset_type == 'Land') {
        return(
            <div>
                <h4>
                    {props.asset_type}
                </h4>
            </div>
        );
    }
}

export default AssetSubForm;
